window.bookSummaryJSON = "<p><b>A cursed goblin sorcerer. The human female he's waited an eternity for. A secret that could tear them apart.</b><br> <br> A quaint cottage in a Scottish forest seemed like the perfect place for Kinsley to start anew. But when a tragic accident leaves her isolated and dying, her new life is over before ever beginning.<br> <br> Until a dark, mysterious being emerges from the night gloom and offers to save her...for a price.<br> <br> With no other choice but death, she accepts. She awakens to find herself bound to an ancient, powerful goblin who is equally terrifying and intriguing. He's terse, demanding, brooding.<br> <br> Despite that, Kinsley is drawn to him, captivated by his sinful crimson eyes, craving his every wicked touch.<br> <br> But what will happen when he discovers the truth? What will happen when he learns that Kinsley cannot fulfill their pact?<br> <br> What will happen if she lets this goblin claim her heart along with her freedom?<br> -----<br> <i>Check the author's website for detailed content warnings.<br> -----<br> Standalone book set in The Cursed Ones Universe. Can be listened to in any order.</i></p>"; 
